com.github._1c_syntax.bsl.types.MultiLan.value:
Введите обоснование, по которому подпись можно считать верной, если подпись не проходит автоматическую проверку. Например, допустимые причины:
- недоступен список отзыва, но известно, что сертификат не отозван; 
- не удается проверить цепочку сертификатов, но это не важно для данной подписи;
- подпись является неквалифицированной (не важна юридическая значимость подписи);
- другие ситуации, не связанные с несоответствием подписи документу (когда документ изменен).
